import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomePage from "./screens/Home";
import NavBar from "./components/Navabar";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <NavBar/>
        <div className="container-fluid">

          <Routes>
            <Route exact path="/" Component={HomePage} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
